import { Button } from 'react-bootstrap';
// This is the starting structure of your cards
const initialCards = [
    { id: 'card-1', title: 'User Interview', stage: 'empathy' },
    { id: 'card-2', title: 'Empathy Map', stage: 'empathy' },
    { id: 'card-3', title: 'Define Problem', stage: 'define' },
    { id: 'card-4', title: 'Problem Statement', stage: 'define' },
    { id: 'card-5', title: 'Ideate Solutions', stage: 'ideate' },
    { id: 'card-6', title: 'Sketching Ideas', stage: 'ideate' },
    { id: 'card-7', title: 'Prototype', stage: 'prototype' },
    { id: 'card-8', title: 'Mockup', stage: 'prototype' },
    { id: 'card-9', title: 'Test', stage: 'test' },
    { id: 'card-10', title: 'Survey Results', stage: 'test' },
    { id: 'card-11', title: 'Analyze Interviews', stage: 'empathy' },
    { id: 'card-12', title: 'Define Metrics', stage: 'define' },
    { id: 'card-13', title: 'Idea Voting', stage: 'ideate' },
    { id: 'card-14', title: 'Prototype Workshop', stage: 'prototype' },
    { id: 'card-15', title: 'Pilot Test' , stage: 'test' },
    { id: 'card-16', title: 'Community focus group', stage: 'empathy' },
    { id: 'card-17', title: 'Define Scope', stage: 'define' },
    { id: 'card-18', title: 'Ideation Session', stage: 'ideate' },
    { id: 'card-19', title: 'Build Rough Model', stage: 'prototype' },
    { id: 'card-20', title: 'Show Stakeholder MVP', stage: 'test' }
  ];



const Sidebar = ({ onAddCard }) => {
  return (
    <div className="sidebar">
      {initialCards.map((card) => (
        <Button key={card.id} variant="secondary" className="mb-2" onClick={() => onAddCard(card)}>
          {card.title}
        </Button>
      ))}
    </div>
  );
};
